import React from 'react';
import Login from './Login';


const Header = () => {
  return (
        <header>
            <a href='#logo' className='logo'>MyBlog</a>
            <nav>
                <a href='/login'><Login /></a>
                <a href='/register'><Register /></a>
            </nav>
        </header>
    )
}

export default Header
